import React from 'react';
import { InputWrapper } from './style';
const Input = props => {
    const {
        type,
        name,
        value,
        placeholder,
        className,
        onChange
    } = props;
    return(
        <InputWrapper className={className} type={type} name={name} value={value} onChange={onChange} placeholder={placeholder}/>
    );
}
export default Input;
